class Application(tk.Frame):
    def __init__(self, master):
        super().__init__(master)
        self.master = master
        self.pack()

        #配置初始化
        fofa_config.config_init()
        #检查配置情况
        self.check_config()

        #爬虫运行标志
        self.flag=False


        #ui整体设置
        self.master.title('fofa_crawler by zny v1.0')
        self.sw = self.master.winfo_screenwidth()
        self.sh = self.master.winfo_screenheight()
        '''
        屏幕高度与宽度
        720X1280
        '''
        self.x = (self.sw - 1000) / 2
        self.y = (self.sh - 600) / 2
        # root.geometry('1000x600+350+150')
        self.master.geometry('1000x600+%d+%d' % (self.x, self.y))
        self.master.resizable(width=False, height=False)

        #修改图标
        self.img = b''
        self.tmp = open("tmp.ico", "wb+")
        self.tmp.write(base64.b64decode(self.img))
        self.tmp.close()
        self.master.iconbitmap("tmp.ico")
        os.remove("tmp.ico")

        #主要函数调用，ui详细设置
        self.child_menu()
        self.search_option()
        self.show_data()

    #检查是否有配置cookie/api秘钥的信息
    #全部没有弹设置页面
    def check_config(self):
        if fofa_config.fofa_email == '' and fofa_config.fofa_key == '' and fofa_config.cookie == '':
            self.fofa_config_set()



