    #爬虫停止
    def stop_crawler(self):
        if self.info.get() != '准备就绪····':
            self.flag=True

    #清除tree_view内容
    def clean_tree_view(self):
        self.jd_info.set("")
        x = self.tree_view.get_children()
        if x == ():
            pass
        else:
            for item in x:
                self.tree_view.delete(item)

            #清空队列
            if self.poc_check_mode == '离线验证' or (self.poc_check_mode =='在线验证' and self.work_mode == 'api模式'):
                self.check_data.queue.clear()
                self.clean_data.queue.clear()

    #搜索关键字处理
    def search_keyeord(self):
        self.keyword = self.Entry_1.get()
        # print(self.keyword)
        self.keyword = base64.b64encode(self.keyword.encode('utf-8')).decode('utf-8')
        if self.work_mode == '爬虫模式':
            self.number = int(int(self.get_number)/10)
        else:
            self.number = int(self.get_number)


    #文件保存处理
    def file_with(self,data):
        if self.file_set == '保存为xlsx':
            fofa_file.file_save_xlsx(data,self.data_set)

        if self.file_set == '保存为txt':
            fofa_file.file_save_txt(data)


    #POC检查
    def poc_check(self,data):

        if self.poc_check_mode == '在线验证':
            if fofa_poc.check(data[0]):
                return False
            else:
                return True
        if self.poc_check_mode == '离线验证':
            if fofa_poc.check(data[0]):
                return False
            else:
                return True

        if self.poc_check_mode == '不验证':
            return False


    #POC离线验证函数
    def poc_check_unline(self):
        self.info.set("离线验证····")
        self.get_control()
        # if self.var2.get() == '离线验证':
        if self.poc_check_mode == '离线验证':
            self.file_path = tk.filedialog.askopenfilename(initialdir=os.path.abspath('.'), title=u'待验证文件',filetypes=[('txt File', '.txt')])
            fofa_file.filename2 = self.file_path
            self.data = fofa_file.file_poc_check()
            self.poc_thread()
            id = 0
            count = 0

            #由于POC验证采用多线程，这里使用while 循环等待poc验证线程结束将结果加入队列
            #下面其他函数中也是一样
            while True:
                self.xc_info.set(self.thread_count + '/' + str(len(threading.enumerate()) - 1))
                while not self.clean_data.empty():
                    data = self.clean_data.get_nowait()
                    id = id + 1
                    count = count + 1
                    self.jd_info.set(self.get_number + '/' + str(count))
                    fofa_file.file_save_txt(data)
                    if (id % 2) == 0:
                        self.tree_view.insert('', 'end', values=(id, data[0]), tags=('oddrow',))
                    else:
                        self.tree_view.insert('', 'end', values=(id, data[0]))
                    self.tree_view.update()

                    if self.flag:
                        self.info.set("准备就绪····")
                        self.flag = False
                        break
                if len(threading.enumerate()) <= 1:
                    self.xc_info.set(self.thread_count + '/' + str(len(threading.enumerate()) - 1))
                    self.info.set("准备就绪····")
                    break



    #数据显示
    def show_option(self,data,id):
        self.show_data_option(data,id)
        if self.show_off:
            pass
        else:
            if (id % 2) == 0:
                self.tree_view.insert('', 'end', values=self.value_list, tags=('oddrow',))
            else:
                self.tree_view.insert('', 'end', values=self.value_list)

    #数据详细程度
    def show_data_option(self,data=None,id=None):
        if data !=None and id != None:
            if self.data_set == '极简数据':
                self.value_list = [id, data[0], data[1]]
            elif self.data_set == '基本数据':
                self.value_list = [id, data[0], data[1], data[2], data[3]]
            elif self.data_set == '详细数据' and self.work_mode == 'api模式':
                self.value_list = [id, data[0], data[1], data[2], data[3], data[4], data[5],data[6]]
            else:
                self.value_list = [id, data[0], data[1], data[2], data[3]]

        else:
            if self.data_set == '极简数据':
                self.fields = 'host,title'
            elif self.data_set == '基本数据':
                self.fields = 'host,title,ip,port'
            elif self.data_set == '详细数据' :
                self.fields = 'host,title,ip,port,domain,server,city'


    # 多线程POC验证
    def poc_thread(self):
        if self.poc_check_mode == '不验证' and self.file_set == '仅显示':
            show_data = []
            for data in self.data:
                #api获取的url有的没有协议头，这里检查加上
                if 'http' in data[0] or 'https' in data[0]:
                    pass
                else:
                    if ':443' in data[0]:
                        data[0] = 'https://' + data[0]
                    else:
                        data[0] = 'http://' + data[0]

                show_data.append(data)
            self.data = show_data
        else:
            self.check_data = queue.Queue()
            self.clean_data = queue.Queue()
            for data in self.data:
                if 'http' in data[0] or 'https' in data[0]:
                    pass
                else:
                    if ':443' in data[0]:
                        data[0] = 'https://' + data[0]
                    else:
                        data[0] = 'http://' + data[0]
                self.check_data.put(data)
            self.thread_list = []
            self.xc_info.set(self.thread_count)
            self.info.set("多线程POC验证····")

            #创建多线程
            for i in range(int(self.thread_count)):
                thread = threading.Thread(target=self.thread_data_handle)
                self.thread_list.append(thread)

            #启动多线程
            for i in range(int(self.thread_count)):
                self.thread_list[i].start()

    #多线程调用数据处理函数
    def thread_data_handle(self):
        while not self.check_data.empty():
            data=self.check_data.get_nowait()

            if self.poc_check(data):
                continue

            self.clean_data.put(data)


    #UI选项控件参数获取
    #由于使用多线程遇到此类“self.var3.get()”会停止运行，不知名原因
    def get_control(self):
        #工作模式
        self.work_mode = self.var1.get()
        #POC验证
        self.poc_check_mode = self.var2.get()
        #线程数
        self.thread_count = self.var3.get()
        #获取数
        self.get_number = self.var4.get()
        #文件保存设置
        self.file_set = self.var5.get()
        #数据详细程度
        self.data_set = self.var6.get()
        #all选项
        self.all_option = self.h1.get()
        #显示关闭
        self.show_off = self.h2.get()


    #函数调用、数据处理
    def data_handle(self):
        self.get_control()
        self.info.set("程序运行····")
        id  = 0
        count = 0
        self.search_keyeord()
        if self.keyword != '':
            if self.work_mode == '爬虫模式':
                self.info.set("爬虫模式运行中····")
                for i in range(1,self.number+1):
                    self.data_content = []
                    if self.flag:
                        self.info.set("准备就绪····")
                        if self.file_set == '保存为xlsx':
                            fofa_file.file_xlsx()
                        self.flag=False
                        break

                    self.data_content=crawler.crawler_request(i,self.keyword,self.all_option)
                    # print(len(self.data_content))
                    for data in self.data_content:
                        if self.poc_check(data):
                            continue
                        id = id + 1
                        count = count +1
                        self.jd_info.set(self.get_number+'/'+str(count))
                        self.file_with(data)
                        self.show_option(data,id)
                    self.tree_view.update()
                    if i == self.number and self.file_set == '保存为xlsx':
                        fofa_file.file_xlsx()
                    time.sleep(5)
            else:
                self.info.set("api模式运行中····")
                self.data = []
                self.show_data_option()
                self.data = crawler.api_fofa(self.number, self.fields, self.keyword)
                self.poc_thread()
                self.xc_info.set(len(threading.enumerate()))
                if self.poc_check_mode == '不验证' and self.file_set == '仅显示':
                    for data in self.data:
                        if self.flag:
                            self.info.set("准备就绪····")
                            self.flag = False
                            break

                        id = id + 1
                        count = count + 1
                        self.jd_info.set(self.get_number + '/' + str(count))
                        self.file_with(data)
                        self.show_option(data,id)
                        self.tree_view.update()
                        if data == self.data[-1]:
                            self.info.set("准备就绪····")


                else:
                    while True:
                        self.xc_info.set(self.thread_count + '/' +str(len(threading.enumerate()) - 1))
                        while not self.clean_data.empty():
                            data = self.clean_data.get_nowait()
                            id = id + 1
                            count = count + 1
                            self.jd_info.set(self.get_number + '/' + str(count))
                            self.file_with(data)
                            self.show_option(data, id)
                            self.tree_view.update()

                            if self.flag:
                                self.info.set("准备就绪····")
                                self.flag = False
                                if self.file_set == '保存为xlsx':
                                    fofa_file.file_xlsx()
                                break
                        if  len(threading.enumerate()) <= 1:
                            self.xc_info.set(self.thread_count + '/' +str(len(threading.enumerate()) - 1))
                            self.info.set("准备就绪····")
                            if self.file_set == '保存为xlsx':
                                fofa_file.file_xlsx()
                            break



